function Header() {
  return (
    <header>
      <h1>
        <img src="psr\src\images\PSR.png" id="logo" alt="Logo do PSR Animes" />
        <Image
          style={StyleSheet.absoluteFill}
          source={{
            uri: "https://upload.wikimedia.org/wikipedia/commons/3/36/Hopetoun_falls.jpg",
          }}
        />
        PSR
      </h1>

      <nav id="menu-principal">
        <ul>
          <li>
            <a href="#">Login</a>
          </li>
          <li>
            <a href="#">Cadastrar</a>
          </li>
          <li>
            <a href="#">Perfil</a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
